  CREATE OR REPLACE FORCE VIEW "MSGADMIN"."ALL_RSVN_VIEW" ("thing_code", "thing_name", "thing_size", "how_long", "res_use_date", "res_return_date") AS 
  select "thing_code","thing_name","thing_size","how_long","res_use_date","res_return_date" from ((select * from car_rsvn_view) union (select * from conf_rsvn_view)) order by "res_use_date" desc
;
--------------------------------------------------------
--  DDL for View CAR_RSVN_SCHE_TRIGGER_VIEW
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "MSGADMIN"."CAR_RSVN_SCHE_TRIGGER_VIEW" ("RES_CODE", "EMP_NO", "EMP_NAME", "JOB_NAME", "DEPT_NAME", "CAR_NAME", "RES_USEDATE", "RES_RETURNDATE") AS 
  select r.res_code, r.emp_no, e.emp_name, j.job_name, d.dept_name, c.car_company||' '||c.car_type car_name, r.res_usedate, r.res_returndate
from emp_tb e join car_rsvn_tb r on e.emp_no = r.emp_no
                    join car_tb c on c.car_code = r.car_code
                    join dept_tb d on e.dept_cd = d.dept_cd
                    join job_tb j on e.job_cd = j.job_cd
;
--------------------------------------------------------
--  DDL for View CAR_RSVN_VIEW
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "MSGADMIN"."CAR_RSVN_VIEW" ("thing_code", "thing_name", "thing_size", "how_long", "res_use_date", "res_return_date", "emp_no", "res_code") AS 
  select r.car_code "thing_code",
		   c.car_company ||'  '|| c.car_type "thing_name",
		   c.car_size "thing_size",
		   (r.res_returndate - r.res_usedate)*24*60 "how_long",
		   r.res_usedate "res_use_date",
		   r.res_returndate "res_return_date",
           r.emp_no "emp_no",
           r.res_code "res_code"
	from car_rsvn_tb r join car_tb c on r.car_code = c.car_code
;
