  CREATE OR REPLACE FORCE VIEW "MSGADMIN"."HEADER_DM_LIST_VIEW" ("EMP_NO", "USER_ID", "EMP_NAME", "JOB_NAME", "EMP_IMAGE", "MSG_DATE", "TO_ID", "READ_DM") AS 
  select 
    E.emp_no, E.user_id, E.emp_name, J.job_name, E.emp_image, D.msg_date, D.to_id, D.read_dm
