--  DDL for View VCTN_ST
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "MSGADMIN"."VCTN_ST" ("VCTN_NO", "DEPT_NAME", "EMP_NAME", "LONGEVITY", "ANNUAL", "REWARD", "USEDDAY") AS 
  SELECT
           E.VCTN_NO
          ,D.DEPT_NAME
          ,B.EMP_NAME
          ,TRUNC(MOD(MONTHS_BETWEEN(SYSDATE,HIRE_DATE)/12,1)*12,0) Longevity
          ,E.ANNUAL
          ,E.REWARD
          ,TRUNC(a.vctn_stdt)-TRUNC(a.vctn_endt)+1 USEDDAY
 FROM VCTN_HIS_TB A         /* 휴가내역 */
         , EMP_TB B                 /* 사원정보 */
         , VCTN_TYPE_TB C     /* 휴가구분 */
         , DEPT_TB D               /* 부서정보 */
         ,VCTN_TB E               /*휴가*/
 WHERE 1=1
     AND A.EMP_NO = B.EMP_NO
     AND A.VCTN_CD = C.VCTN_CD
     AND B.DEPT_CD = D.DEPT_CD
     AND B.EMP_NO = E.EMP_NO
;
