--------------------------------------------------------
--  DDL for Procedure PROC_BIRTH_TO_SCHED
--------------------------------------------------------
set define off;

  CREATE OR REPLACE PROCEDURE "MSGADMIN"."PROC_BIRTH_TO_SCHED" (empNo in NUMBER)
is
emp varchar2(30):='님 생일';
sche_name_ sched_tb.sche_name%type;
cnt number := 1;
begin
     --만약 생일이 이미 등록되어 있지 않으면
     FOR empName IN ( SELECT emp_name
             FROM emp_birth_view
            )
      LOOP
      
      

      --emp_name을 하나씩 가져오기
      select s.*
      into sche_name_
      from (
        select sche_name
        from sched_tb
        where emp_name = empName.emp_name
      ) s
      where rownum = cnt; 
      
      dbms_output.put_line(empName.emp_name);
      dbms_output.put_line(empName.emp_name||emp);
      dbms_output.put_line(sche_name_);

    if (empName.emp_name||emp != sche_name_) then
        select seq_sche_schecode.nextval, '직원 생일', emp_no, emp_name, job_name, dept_name, sche_name, sche_birth, sche_birth, '#dc2543', emp_name||'님의 생일을 축하드립니다!','Y',null 
        from emp_birth_view
        where emp_name = empName.emp_name;
    end if;
    
    cnt := cnt + 1;
    end loop;

end;

/
