--  DDL for Procedure PROC_CLOCK_IN_UPDATE_TEMP
--------------------------------------------------------
set define off;

  CREATE OR REPLACE PROCEDURE "MSGADMIN"."PROC_CLOCK_IN_UPDATE_TEMP" 
IS
tempday varchar2(10) := '2020-04-';
clockIn date;
tday number := 1;
BEGIN

    FOR emp IN ( SELECT emp_no
             FROM emp_tb
            )
      LOOP

        WHILE(tday<11)
        LOOP
    
            SELECT NVL(MAX(TAKEN), TO_DATE(tempday||tday||' 12:59','YYYY-MM-DD HH24:mi'))
            INTO clockIn
            FROM(
                SELECT TAKEN
                FROM LOG_TB L
                WHERE TO_CHAR(TAKEN,'YYYY-MM-DD') = TO_CHAR(TO_DATE(tempday||tday,'YYYY-MM-DD'),'YYYY-MM-DD')  
                AND INOUT_FG IN 'I' AND EMP_NO = emp.emp_no
                order by TAKEN
            ) where rownum = 1;
            
            dbms_output.put_line( 'emp.emp_no = ' ||emp.emp_no || ', tday = ' || tday  );
            dbms_output.put_line( TO_CHAR(TO_DATE(tempday||tday,'YYYY-MM-DD'),'YYYY-MM-DD') );
            dbms_output.put_line( TO_CHAR(clockIn,'YYYY-MM-DD HH24:mi') );
            
            --출근 기록이 없다면
            if clockIn = TO_DATE(tempday||tday||' 12:59','YYYY-MM-DD HH24:mi') then 
            --출근 기록이 있다면
            else 
                            
                update WORK_TIMES_TB SET CLOCK_IN = clockIn, REMARK = '' WHERE EMP_NO = emp.emp_no AND TO_CHAR(WORK_DAY,'YYYY-MM-DD') = TO_CHAR(clockIn,'YYYY-MM-DD');
                
        
            end if;    
    
            tday := tday+1;
    
    
        end loop;
            tday := 1;
    end loop;

END;

