--  DDL for Procedure PROC_INSERT_LATE_TB
--------------------------------------------------------
set define off;

  CREATE OR REPLACE PROCEDURE "MSGADMIN"."PROC_INSERT_LATE_TB" (empNo in NUMBER)
is
    clockin TEMP_WORK_TB.CLOCK_IN%type;
    cnt number;
begin
    --오늘의 기준 출근 시간 구하기
    SELECT CLOCK_IN
    into clockin
    FROM TEMP_WORK_TB
    WHERE TO_CHAR(WORK_DAY,'YYYY-MM-DD') = TO_CHAR(SYSDATE,'YYYY-MM-DD');

    --오늘의 출근기록 유무
    SELECT NVL(count(*),0) 
    into cnt
    FROM LOG_TB
    WHERE TO_CHAR(TAKEN,'YYYY-MM-DD') = TO_CHAR(SYSDATE,'YYYY-MM-DD') 
            AND INOUT_FG IN 'I' AND EMP_NO = empNo;

    --만약 오늘 출근시간이 존재 하지 않고,
    if cnt = 0 then
        --오늘의 기준 출근시간보다 늦게 출근했다면, 지각
        if clockin < sysdate then
            UPDATE WORK_TIMES_TB SET CLOCK_IN = SYSDATE , REMARK = '지각' WHERE EMP_NO = empNo AND TO_CHAR(WORK_DAY,'YYYY-MM-DD') = TO_CHAR(sysdate,'YYYY-MM-DD');
        --정상 출근 했다면 WORK_TIMES_TB 에 기록    
        else
            UPDATE WORK_TIMES_TB SET CLOCK_IN = SYSDATE, REMARK = '출근' WHERE EMP_NO = empNo AND TO_CHAR(WORK_DAY,'YYYY-MM-DD') = TO_CHAR(sysdate,'YYYY-MM-DD');
        end If;
    end if;
end;

