/
--------------------------------------------------------
--  DDL for Procedure PROC_UPDATE_REMARK
--------------------------------------------------------
set define off;

  CREATE OR REPLACE PROCEDURE "MSGADMIN"."PROC_UPDATE_REMARK" 
IS
tempday varchar2(10) := '2020-04-';
clockin date;
clockout date;
sclockin date;
sclockout date;
tday number := 1;
uremark varchar2(100);

BEGIN
    


    FOR emp IN ( SELECT emp_no
             FROM emp_tb
            )
      LOOP

        WHILE(tday<10)
        LOOP
            
            SELECT NVL(MAX(CLOCK_IN),NULL)
            INTO sclockin
            FROM TEMP_WORK_TB
            WHERE TO_CHAR(WORK_DAY,'YYYY-MM-DD') = TO_CHAR(TO_DATE(tempday||tday,'YYYY-MM-DD'),'YYYY-MM-DD');
        
            SELECT NVL(MAX(CLOCK_OUT),NULL)
            INTO sclockout
            FROM TEMP_WORK_TB
            WHERE TO_CHAR(WORK_DAY,'YYYY-MM-DD') = TO_CHAR(TO_DATE(tempday||tday,'YYYY-MM-DD'),'YYYY-MM-DD');
            
               
            SELECT *
            INTO clockin
            FROM(
                SELECT TAKEN
                FROM LOG_TB L
                WHERE TO_CHAR(TAKEN,'YYYY-MM-DD') = TO_CHAR(TO_DATE(tempday||tday,'YYYY-MM-DD'),'YYYY-MM-DD')  
                AND INOUT_FG IN 'I' AND EMP_NO = emp.emp_no
                order by TAKEN
            ) where rownum = 1;
            
            SELECT *
            INTO clockout
            FROM(
                SELECT TAKEN
                FROM LOG_TB L
                WHERE TO_CHAR(TAKEN,'YYYY-MM-DD') = TO_CHAR(TO_DATE(tempday||tday,'YYYY-MM-DD'),'YYYY-MM-DD')  
                AND INOUT_FG IN 'O' AND EMP_NO = emp.emp_no
                order by TAKEN desc
            ) where rownum = 1;
            
            
            dbms_output.put_line( 'clockin = '|| TO_CHAR(clockin,'YYYY-MM-DD HH24:mi') );
            dbms_output.put_line( 'clockout = '|| TO_CHAR(clockout,'YYYY-MM-DD HH24:mi') );
            
            if sclockin < clockin then
                uremark := '지각';
                if sclockout > clockout then
                    uremark := '지각, 조퇴';
                else
                    uremark := '조퇴';
                end if;
            end if;
            
            if sclockin  > clockin and sclockout < clockout then
                uremark := '출근';
            end if;
            
            UPDATE WORK_TIMES_TB SET REMARK = uremark WHERE EMP_NO = emp.emp_no AND TO_CHAR(WORK_DAY,'YYYY-MM-DD') = TO_CHAR(clockout,'YYYY-MM-DD');
            
            tday := tday + 1;
    
        end loop;
            tday := 1;
    end loop;

END;

/
--------------------------------------------------------
--  DDL for Procedure PROC_UPDATE_WORK_TIMES
--------------------------------------------------------
set define off;

  CREATE OR REPLACE PROCEDURE "MSGADMIN"."PROC_UPDATE_WORK_TIMES" 

IS

lastclocko LOG_TB.TAKEN%type;
islogout NUMBER := 0;
islogin NUMBER := 0;
islate NUMBER := 0;
tdayclocko TEMP_WORK_TB.CLOCK_OUT%type;

BEGIN

FOR emp IN ( SELECT emp_no
             FROM emp_tb
            )
      LOOP

        --오늘 퇴근 기록 유무
        --결근유무
        SELECT NVL(MAX(COUNT(*)),0)
        INTO islogout
        FROM LOG_TB
        WHERE EMP_NO IN emp.emp_no
        AND INOUT_FG = 'O'
        AND TO_CHAR(TAKEN,'YYYY-MM-DD') = TO_CHAR(SYSDATE,'YYYY-MM-DD')
        GROUP BY EMP_NO;

        --오늘 출근 기록 유무
        --결근 유무
        SELECT NVL(MAX(COUNT(*)),0)
        INTO islogin
        FROM LOG_TB
        WHERE EMP_NO IN emp.emp_no
        AND INOUT_FG = 'O'
        AND TO_CHAR(TAKEN,'YYYY-MM-DD') = TO_CHAR(SYSDATE,'YYYY-MM-DD')
        GROUP BY EMP_NO;


        --오늘 기준 퇴근 시간
        --조퇴 유무
        SELECT CLOCK_OUT
        into tdayclocko
        FROM TEMP_WORK_TB
        WHERE TO_CHAR(WORK_DAY,'YYYY-MM-DD') = TO_CHAR(SYSDATE,'YYYY-MM-DD');

        --오늘 지각 유무
        SELECT NVL(MAX(COUNT(*)),0)
        INTO islate
        FROM WORK_TIMES_TB
        WHERE EMP_NO IN emp.emp_no
        AND TO_CHAR(WORK_DAY,'YYYY-MM-DD') = TO_CHAR(SYSDATE,'YYYY-MM-DD')
        AND REMARK = '지각'
        GROUP BY EMP_NO;


        --출근기록과 퇴근기록이 있다면...
        if islogin != 0 AND islogout != 0 then
            --오늘자 마지막 퇴근 기록
            SELECT * 
            INTO lastclocko
            FROM (
                SELECT TAKEN
                FROM LOG_TB
                WHERE EMP_NO IN emp.emp_no
                AND INOUT_FG = 'O'
                AND TO_CHAR(TAKEN,'YYYY-MM-DD') = TO_CHAR(SYSDATE,'YYYY-MM-DD')
                ORDER BY TAKEN DESC)
            WHERE ROWNUM =1;

            --조퇴 업데이트
            --마지막 퇴근 기록이 오늘 기준퇴근 시간 보다 이르다면 조퇴
            if lastclocko < tdayclocko then
                --지각을 했다면 '지각,조퇴'
                if islate != 0 then
                    UPDATE WORK_TIMES_TB SET REMARK = '지각,조퇴', CLOCK_OUT = lastclocko WHERE EMP_NO = emp.emp_no AND TO_CHAR(WORK_DAY,'YYYY-MM-DD') = TO_CHAR(SYSDATE,'YYYY-MM-DD');
                --지각이 없다면 '조퇴'
                else 
                    UPDATE WORK_TIMES_TB SET REMARK = '조퇴', CLOCK_OUT = lastclocko WHERE EMP_NO = emp.emp_no AND TO_CHAR(WORK_DAY,'YYYY-MM-DD') = TO_CHAR(SYSDATE,'YYYY-MM-DD');
                end if;
            --마지막 퇴근 기록이 오늘 기준퇴근 시간 보다 늦고 지각이 없다면 정상
            else if islate = 0 then
                UPDATE WORK_TIMES_TB SET REMARK = '정상', CLOCK_OUT = lastclocko WHERE EMP_NO = emp.emp_no AND TO_CHAR(WORK_DAY,'YYYY-MM-DD') = TO_CHAR(SYSDATE,'YYYY-MM-DD');
            end if;
            end if;
        end if;

        --출근시간과 퇴근 시간이 없다면 '결근'
        --결근 테이블 업데이트
        --결근 처리
        if islogin = 0 AND islogout = 0 then
            UPDATE WORK_TIMES_TB SET REMARK = '결근' WHERE EMP_NO = emp.emp_no AND TO_CHAR(WORK_DAY,'YYYY-MM-DD') = TO_CHAR(SYSDATE,'YYYY-MM-DD');
        end if;
        
        --로그인 기록은 있지만 퇴근 기록이 없다면, 결근
        if islogin != 0 AND islogout = 0 then
            UPDATE WORK_TIMES_TB SET REMARK = '결근' WHERE EMP_NO = emp.emp_no AND TO_CHAR(WORK_DAY,'YYYY-MM-DD') = TO_CHAR(SYSDATE,'YYYY-MM-DD');
        end if;

      END LOOP;
END;

